//@ts-nocheck
import '../styles/Global.css';
import Category from '../components/Category';

function App() {
  return (
    <div className="App">
      <h1>Grupo - 3</h1>
      <h2>Head2</h2>
      <h3>Head3</h3>
      <h4>Head4</h4>

      <button className="btn-1" type="button"> Click-1 </button>
      <button className="btn-2" type="button"> Click-2 </button>

      <p className="txt-1">Texto 1</p>
      <p className="txt-2">Texto 2</p>
      <p>Solo texto</p>
      <Category />
    </div>
  );
}

export default App;
